import React from 'react';
import {makeStyles} from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';

const useStyles = makeStyles({
    table: {
        minWidth: 650,
        maxWidth: 400,
    },
});

const createTableComponent = (props) => {
    const classes = useStyles();
    const tableHeaders = props.tableHeaders || [];
    const tableData = props.tableData || [];

    return (<Table className={classes.table} aria-label="simple table">
        <TableHead>
            <TableRow key={0}>
                {tableHeaders.map((header) => {
                    return <TableCell>{header}</TableCell>;
                })}
            </TableRow>
        </TableHead>
        <TableBody>
            {tableData.map((data,rowIdx) => {
                return <TableRow key={rowIdx + 1}> {Object.keys(data).map((key,idx) => {
                    return <TableCell>{data[key]}</TableCell>;
                })}
                </TableRow>
            })}
        </TableBody>
    </Table>);
}

export default function BasicTable(props) {
    const tableComponent = createTableComponent(props);
    return (
        <TableContainer component={Paper}>
            {tableComponent}
        </TableContainer>
    );
}
